    return (
    <div className="sql-display">
        <div className="sql-display-buttons">
            <div className="button first"></div>
            <div className="button second"></div>
            <div className="button third"></div>
        </div>
        <div className="code">
            <p></p>
        </div>
    </div>
);
}

